import styled from 'styled-components';

export const NavBar = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 20px;
  height: 105px;
  background-color: #000;
`;

export const Buttons = styled.div`
  display: flex;
  justify-content: flex-end;
  width: 400px;
`  

export const Button = styled.p`
  margin-right: 80px;
  color: #fff;
  font-size: 26px;
  font-weight: 600;
  &:hover {
    color: #ffcc00;
  }
`;
